import React from 'react';

import './PlayTable.css';
const cardFolder= '/cards/'



const PlayTable = ({trick}) => (
    <div className="playTable">
        {trick ? (
        <div>
            <div className="activeContainer">
                {trick.map ((card, index) => (
                    <div key="{index}" className="activeItem">
                         Card: {card}
                        <img alt="card" src={process.env.PUBLIC_URL + `${cardFolder}${card}.png`}/>
                    </div>
                   // console.log('user in room: ' + user.name)
                ))}
            </div>
            <h2>Total: {trick.length}</h2>
        </div>
        ) : null }
    </div>
);


export default PlayTable;
